import routes from './routes';
import { db } from './database';


let server;

const start = async () => {
    server = Hapi.server({
        port: 8000,
        host: 'localhost',
    });
    routes.forEach(route=>server.route(route));
    db.connect();

    await server.start();
    console.log(`Server is listening on ${server.info.uri}`);
}

